const Breadcrumb = props => (
  <nav className="breadcrumb is-desktop-only" aria-label="breadcrumbs">
    <ul>
      <li>
        <a href="/">Home</a>
      </li>
      {props.children}
    </ul>
  </nav>
);

export default Breadcrumb;
